package com.amandris.clients.service.vo;import java.io.Serializable;import java.util.Date;public class ContactMessage implements Serializable{	private Integer id;	private Integer contactId;	private String 	text;	private Date 	date;	private Integer sentFromBuyer;	private Integer isNew;	private Contact contact;	private static final long serialVersionUID = 6526471155622776010L;		public Contact getContact() {		return contact;	}	public void setContact(Contact contact) {		this.contact = contact;	}	public Integer getContactId() {		return contactId;	}	public void setContactId(Integer contactId) {		this.contactId = contactId;	}	public Date getDate() {		return date;	}	public void setDate(Date date) {		this.date = date;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getIsNew() {		return isNew;	}	public void setIsNew(Integer isNew) {		this.isNew = isNew;	}	public Integer getSentFromBuyer() {		return sentFromBuyer;	}	public void setSentFromBuyer(Integer sentFromBuyer) {		this.sentFromBuyer = sentFromBuyer;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}}